import React from 'react';


const Imageform = () =>{
	return (		
		<div>
			<p className='f3'>{'This Magic Brain will detect faces in your pictures.'}</p>
			<div>
			<input type='tex'/>
			</div>
		</div>
	)
}

export default Imageform;
